import React from 'react';
import Card from './Card'; // Assuming Card is in the same directory
import { CardContainer } from './StyledComp'; // Assuming the styles are here

function App() {
  return (
    <ParentContainer>   
             <CardContainer startColor="red" endColor="#0C356A">
      <Card image="https://source.unsplash.com/user/erondu/600x400?1" title="Card 1" text="This is the first card" />
      <Card image="https://source.unsplash.com/user/erondu/600x400?2" title="Card 2" text="This is the second card" />
      <Card image="https://source.unsplash.com/user/erondu/600x400?3" title="Card 3" text="This is the third card" />
      <Card image="https://source.unsplash.com/user/erondu/600x400?4" title="Card 4" text="This is the fourth card" />
      <Card image="https://source.unsplash.com/user/erondu/600x400?5" title="Card 5" text="This is the fifth card" />
      <Card image="https://source.unsplash.com/user/erondu/600x400?6" title="Card 6" text="This is the sixth card" />
    </CardContainer>
    </ParentContainer>

  );
}

export default App;

const ParentContainer = styled.div`
    display: flex;
    justify-content: center;
`;
